import React from 'react'
import Popular from '../../../interface/Popular';

interface PopularProps {
  populars: Popular[];
}
const PopularRestaurant:React.FC<PopularProps> = ({populars}: PopularProps) => {
  {populars.map(item => {
    return  (
    <p className="popular-item">
        <h2>{item.restaurantName}</h2>
        <p>{item.chefName}</p>
    </p>
  )
})}
}

export default PopularRestaurant;
